  CONSTRAINT `gift_ibfk_2` FOREIGN KEY (`giftSender`) REFERENCES `user` (`userId`),
  CONSTRAINT `gift_ibfk_3` FOREIGN KEY (`giftReceiver`) REFERENCES `user` (`userId`)
